import React from 'react';
import './todo-list.css';

import TodoGroup from '../todo-group/todo-group';

const  TodoList = ({data}) => {
  const groups = new Set(data.map((item)=> item.group));

  const todoListMarkup = Array.from(groups).map((group) => (
    <TodoGroup items={data.filter((item) => item.group === group)} key='group' />
  ));

  return (<section className='todo-list'>
    {}
  </section>);
};

export default TodoList;
